import HallRow from '../HallRow';

function McKinsey()
{
    return (
        <div className="McKinsey">
            <HallRow totalSeats={10} startSeatNum={1} />
            <HallRow totalSeats={5} startSeatNum={11} />
            <HallRow totalSeats={5} startSeatNum={16} />
            <HallRow totalSeats={5} startSeatNum={21} />
            <HallRow totalSeats={10} startSeatNum={26} />
        </div>
    )
}

export default McKinsey;
